--%%%%%%%%%%%%%%%%%%%% Basic Functions %%%%%%%%%%%%%%%%%%%%--{{{1\
--%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%{{{2\
--\
--  Function: ADD \
--\
--\
--  Description:\
--     Adds two Big Numbers.\
--\
--  Parameters:\
--     bnum1, bnum2 - Numbers to be added.\
--     bnum3 - result\
--\
--  Returns:\
--     0\
--\
--  Exit assertions:\
--     bnum3 is the result of the sum.\
--\
--  %%%%%%%% --\
--Funcao BigNum.add{{{2\
function BigNum.add( bnum1 , bnum2 , bnum3 )\
   local maxlen = 0 ;\
   local i = 0 ;\
   local carry = 0 ;\
   local signal = '+' ;\
   local old_len = 0 ;\
   --Handle the signals\
   if bnum1 == nil or bnum2 == nil or bnum3 == nil then\
      error(\"Function BigNum.add: parameter nil\") ;\
   elseif bnum1.signal == '-' and bnum2.signal == '+' then\
      bnum1.signal = '+' ;\
      BigNum.sub( bnum2 , bnum1 , bnum3 ) ;\
\
      if not rawequal(bnum1, bnum3) then\
         bnum1.signal = '-' ;\
      end\
      return 0 ;\
   elseif bnum1.signal == '+' and bnum2.signal == '-' then   \
      bnum2.signal = '+' ;\
      BigNum.sub( bnum1 , bnum2 , bnum3 ) ;\
      if not rawequal(bnum2, bnum3) then\
         bnum2.signal = '-' ;\
      end\
      return 0 ;\
   elseif bnum1.signal == '-' and bnum2.signal == '-' then\
      signal = '-' ;\
   end\
   --\
   old_len = bnum3.len ;\
   if bnum1.len > bnum2.len then\
      maxlen = bnum1.len ;\
   else\
      maxlen = bnum2.len ;\
      bnum1 , bnum2 = bnum2 , bnum1 ;\
   end\
   --School grade sum\
   for i = 0 , maxlen - 1 do\
      if bnum2[i] ~= nil then\
         bnum3[i] = bnum1[i] + bnum2[i] + carry ;\
      else\
         bnum3[i] = bnum1[i] + carry ;\
      end\
      if bnum3[i] >= RADIX then\
         bnum3[i] = bnum3[i] - RADIX ;\
         carry = 1 ;\
      else\
         carry = 0 ;\
      end\
   end\
   --Update the answer's size\
   if carry == 1 then\
      bnum3[maxlen] = 1 ;\
   end\
   bnum3.len = maxlen + carry ;\
   bnum3.signal = signal ;\
   for i = bnum3.len, old_len do\
      bnum3[i] = nil ;\
   end\
   return 0 ;\
end\
\
\
--%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%{{{2\
--\
--  Function: SUB \
--\
--\
--  Description:\
--     Subtracts two Big Numbers.\
--\
--  Parameters:\
--     bnum1, bnum2 - Numbers to be subtracted.\
--     bnum3 - result\
--\
--  Returns:\
--     0\
--\
--  Exit assertions:\
--     bnum3 is the result of the subtraction.\
--\
--  %%%%%%%% --\
--Funcao BigNum.sub{{{2\
function BigNum.sub( bnum1 , bnum2 , bnum3 )\
   local maxlen = 0 ;\
   local i = 0 ;\
   local carry = 0 ;\
   local old_len = 0 ;\
   --Handle the signals\
   \
   if bnum1 == nil or bnum2 == nil or bnum3 == nil then\
      error(\"Function BigNum.sub: parameter nil\") ;\
   elseif bnum1.signal == '-' and bnum2.signal == '+' then\
      bnum1.signal = '+' ;\
      BigNum.add( bnum1 , bnum2 , bnum3 ) ;\
      bnum3.signal = '-' ;\
      if not rawequal(bnum1, bnum3) then\
         bnum1.signal = '-' ;\
      end\
      return 0 ;\
   elseif bnum1.signal == '-' and bnum2.signal == '-' then\
      bnum1.signal = '+' ;\
      bnum2.signal = '+' ;\
      BigNum.sub( bnum2, bnum1 , bnum3 ) ;\
      if not rawequal(bnum1, bnum3) then\
         bnum1.signal = '-' ;\
      end\
      if not rawequal(bnum2, bnum3) then\
         bnum2.signal = '-' ;\
      end\
      return 0 ;\
   elseif bnum1.signal == '+' and bnum2.signal == '-' then\
      bnum2.signal = '+' ;\
      BigNum.add( bnum1 , bnum2 , bnum3 ) ;\
      if not rawequal(bnum2, bnum3) then\
         bnum2.signal = '-' ;\
      end\
      return 0 ;\
   end\
   --Tests if bnum2 > bnum1\
   if BigNum.compareAbs( bnum1 , bnum2 ) == 2 then\
      BigNum.sub( bnum2 , bnum1 , bnum3 ) ;\
      bnum3.signal = '-' ;\
      return 0 ;\
   else\
      maxlen = bnum1.len ;\
   end\
   old_len = bnum3.len ;\
   bnum3.len = 0 ;\
   --School grade subtraction\
   for i = 0 , maxlen - 1 do\
      if bnum2[i] ~= nil then\
         bnum3[i] = bnum1[i] - bnum2[i] - carry ;\
      else\
         bnum3[i] = bnum1[i] - carry ;\
      end\
      if bnum3[i] < 0 then\
         bnum3[i] = RADIX + bnum3[i] ;\
         carry = 1 ;\
      else\
         carry = 0 ;\
      end\
\
      if bnum3[i] ~= 0 then\
         bnum3.len = i + 1 ;\
      end\
   end\
   bnum3.signal = '+' ;\
   --Check if answer's size if zero\
   if bnum3.len == 0 then\
      bnum3.len = 1 ;\
      bnum3[0]  = 0 ;\
   end\
   if carry == 1 then\
      error( \"Error in function sub\" ) ;\
   end\
   for i = bnum3.len , max( old_len , maxlen - 1 ) do\
      bnum3[i] = nil ;\
   end\
   return 0 ;\
end\
\
