-- rotate word: 0xaabbccdd gets 0xbbccddaa\
-- used for key schedule\
--\
local function rotWord(word)\
	local tmp = bit.band(word,0xff000000)\
	return (bit.lshift(word,8) + bit.rshift(tmp,24))\
