local function subWord(word)\
	return putByte(SBox[getByte(word,0)],0)\
		+ putByte(SBox[getByte(word,1)],1)\
		+ putByte(SBox[getByte(word,2)],2)\
		+ putByte(SBox[getByte(word,3)],3)\
