											 gf.mul(0x0d, b3)),\
											 gf.mul(0x09, b0)),\
											 gf.mul(0x0e, b1)),2)\
		 + putByte(gf.add(gf.add(gf.add(gf.mul(0x0b, b3),\
											 gf.mul(0x0d, b0)),\
											 gf.mul(0x09, b1)),\
											 gf.mul(0x0e, b2)),1)\
		 + putByte(gf.add(gf.add(gf.add(gf.mul(0x0b, b0),\
											 gf.mul(0x0d, b1)),\
											 gf.mul(0x09, b2)),\
											 gf.mul(0x0e, b3)),0)\
