\
	if (key[KEY_TYPE] ~= ENCRYPTION_KEY) then\
		print(\"No encryption key: \", key[KEY_TYPE])\
		return\
	end\
\
	state = util.bytesToInts(input, inputOffset, 4)\
	addRoundKey(state, key, 0)\
\
	local checkIn = util.sleepCheckIn\
