local split = function(str)\
	local f = str:find(\" \") or #str+1\
	local command = str:sub(1,f-1)\
	local argsstr = str:sub(f+1,-1)\
	local args = {}\
	for token in argsstr:gmatch(\"[^%s]+\") do\
		args[#args+1] = token\
	end\
	return command:lower(), args\
end\
